or, preencha todos os espaços em branco para visualizar a solução\",\"notFilledOut\":\"Por favor preencha todos os espaços em branco\",\"answerIsCorrect\":\"':ans' está correta\",\"answerIsWrong\":\"':ans' está incorreta\",\"answeredCorrectly\":\"Respondido incorretamente\",\"answeredIncorrectly\":\"Respondido corretamente\",\"solutionLabel\":\"Espaço em branco @num de @total\",\"inputLabel\":\"Resposta aberta @num de um total de @total\",\"inputHasTipLabel\":\"Dica disponível\",\"tipLabel\":\"Dica\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"autoCheck\":false,\"caseSensitive\":true,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"acceptSpellingErrors\":false},\"scoreBarLabel\":\"Conseguiu :num pontos de um total de :total\",\"a11yCheck\":\"Mostrar a solução. A atividade será marcada com a respetiva solução correta.\",\"a11yShowSolution\":\"Mostrar a solução. A tarefa será marcada com a sua solução correta.\",\"a11yRetry\":\"Tente de novo. Apagar todas as respostas e iniciar de novo.\",\"a11yCheckingModeHeader\":\"Modo de verificação\",\"confirmCheck\":{\"header\":\"Tentar novamente?\",\"body\":\"Tem a certeza de que pretende tentar novamente?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Terminar\"},\"confirmRetry\":{\"header\":\"Repetir ?\",\"body\":\"Tem a certeza que deseja repetir?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Confirmar\"},\"questions\":[\"<p>A roda dos *alimentos* representa a diversidade de alimentos que precisamos para ter uma dieta equilibrada.&nbsp;&nbsp;Esta dividida em &nbsp;*sete* grupos de alimentos cujos tamanhos representam a proporção com que os devemos ingerir diariamente.&nbsp;</p>\\n\\n<p>A *água* está no centro da roda. Embora esteja presente em todos os &nbsp;*alimentos*, devemos beber 1,5l de água todos os *dias*. Através da roda dos alimentos é possivel ter uma alimentação *completa* ingerindo alimentos de todos os grupos, *equilibrada* priviligiando os grupos de alimentos que se encontram em maior proporção e respeitando o números de porções recomendadas e *variada* consumindo alimentos diferentes dentro de cada grupo dando preferência às horticolas e à fruta.&nbsp;Deves evitar os *doces*.pois quando ingeridos em demasia prejudicam a saúde causando doenças como a diabetes.</p>\\n\"]}","library":"H5P.Blanks 1.14","contentUrl":".","metadata":{"license":"U","title":"Alimentação saudável","defaultLanguage":"en"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?version=1.3.19","/h5p/libraries/H5P.Question-1.5/scripts/question.js?version=1.5.15","/h5p/libraries/H5P.Question-1.5/scripts/explainer.js?version=1.5.15","/h5p/libraries/H5P.Question-1.5/scripts/score-points.js?version=1.5.15","/h5p/libraries/H5P.TextUtilities-1.3/scripts/text-utilities.js?version=1.3.0","/h5p/libraries/H5P.Blanks-1.14/js/blanks.js?version=1.14.11","/h5p/libraries/H5P.Blanks-1.14/js/cloze.js?version=1.14.11"],"styles":["/h5p/libraries/H5P.Image-1.1/image.css?version=1.1.22","/h5p/libraries/FontAwesome-4.5/h5p-font-awesome.min.css?ve
